import React from "react";
const Pago = () =>{
    return(
        <>
        <div className="container">
            <div className="containerImg">

            </div>
            <div className="containerContent">
                <h1>Minecraft</h1>
                <div className="containerCosts">
                    <h3>Precio<p>$20</p></h3>
                    
                </div>
            </div>
        </div>
        </>
    );
}
export default Pago;
